import React, { useState, useEffect } from "react";
import axios from "axios";

function TestingAPI() {
  const Rest_api = "http://localhost:8080/api/users";
  const [data, setData] = useState("");

  useEffect(() => {
    axios
      .get(Rest_api)
      .then((response) => {
        setData(response.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  console.log(data);
  return (
    <div>
      {data.map((data) => {
        <tr>
          <td>{data.id}</td>
        </tr>;
      })}
    </div>
  );
}

export default TestingAPI;
